import React from "react";
import "../css/home.css";
import { Grid, Button } from "@material-ui/core";

const Home = () => {
    return (
        <>
            <Grid container className="computer">
                <Grid
                    item
                    xs={12}
                    container
                    direction="row"
                    justify="center"
                    spacing={2}
                    className="title"
                >
                    <Grid item>
                        <h1>Maxence</h1>
                    </Grid>
                    <Grid item>
                        <h1 className="alt">Liboz</h1>
                    </Grid>
                </Grid>
                <Grid item xs={12} container justify="center">
                    <div>
                        <h1>â†“</h1>
                        <Button
                            className="button"
                            style={{
                                color: "white",
                                height: "2em",

                                border: "solid 3px #f95a00",
                                borderRadius: "15px",
                                padding: "1em 3em",
                            }}
                        >
                            En savoir plus
                        </Button>
                    </div>
                </Grid>
            </Grid>
        </>
    );
};

export default Home;
